$("#andre").click(function(){
  var clicks = $(this).data('clicks');
  if (clicks) {
    $("#andre").css({"rx": "4.84px", "ry": "3.75px", "opacity" : "1"});
    $("#andre_card").css({"display": "none"});

  $(this).data("clicks", !clicks);
});
